import React from 'react';
import "./Home.css";
import headshot from './assets/profile-pic.jpg';
import linkedin from './assets/linkedin.png';
import github from './assets/github.png';

const Home = () => (
    <section className="home">
        <div className="home-container">
            <div className="right-side">
                <img className="headshot" src={headshot} alt="Toni's headshot" />
            </div>
            <div className="left-side">
                <h3>Hello my name</h3>
                <h1>Antonio Mendoza</h1>
                <h3>Computer Science Student at University of Georgia</h3>
                <div className="btns">
                    <a href="https://linkedin.com/in/antonio-mendoza01/" target="_blank"><button className="link-btn" link=""><img className="logo" src={linkedin} alt="linkedin button"/>Download CV</button></a>
                    <a ><button className="link-btn">Contact Me</button></a>
                    <a href="https://github.com/amendoza09" target="_blank"><img className="logo" src={github} alt="github button"/></a>
                </div>
            </div>
        </div>
    </section>
);

export default Home;
